import React from "react";
import { Switch, Route, Link } from "react-router-dom";
import "bootstrap/dist/css/bootstrap.min.css";

import College from "./components/colleges";
import CollegesList from "./components/colleges-list";
// import Login from "./components/login";

function App() {


  return (
    <div>
      <nav className="navbar navbar-expand navbar-dark bg-dark">
        <a href="/colleges" className="navbar-brand">
          Top 100 Engineering Colleges In India
        </a>
        <div className="navbar-nav mr-auto">
          <li className="nav-item">
            <Link to={"/colleges"} className="nav-link">
              Colleges
            </Link>
          </li>

        </div>
      </nav>

      <div className="container mt-3">
        <Switch>
          <Route exact path={["/", "/colleges"]} component={CollegesList} />
          <Route 
            path="/colleges/:id/students"
            render={(props) => (
              <AddReview {...props}  />
            )}
          />
          <Route 
            path="/colleges/:id"
            render={(props) => (
              <College {...props} user={user} />
            )}
          />
        </Switch>
      </div>
    </div>
  );
}

export default App;
